import React from 'react';
import Booklist from "./components/Booklist";

const App = () => {
  const languages = ['React', 'Anguler', 'Vue'];
  return (
    <div>
      <h1>react app</h1>
      <Booklist
        languages = {languages[0]}
      />
      <Booklist
        languages={languages[1]}
      />
      <Booklist
        languages={languages[3]}
      />
    </div>
  );
}

export default App;
